import React, { Component } from 'react';
import {View,StyleSheet} from "react-native";

import { Button,Text} from 'react-native-elements';



export default class homeScreen extends Component {

  render() {
   const {navigate} = this.props.navigation; 
    return (<View>
       <Text
          style={styles.text}
          h1
        >
          Welcome to our app!
        </Text>
      <Button
                title="Log in"
                loading={false}
                loadingProps={{ size: 'small', color: 'white' }}
                buttonStyle={{
                  backgroundColor: 'rgba(111, 202, 186, 1)',
                  borderRadius: 5,
                }}
                titleStyle={{ fontWeight: 'bold', fontSize: 23 }}
                containerStyle={{
                  marginHorizontal: 50,
                  height: 50,
                  width: 200,
                  marginVertical: 10,
                }}
                onPress={() => Navigate('LoginScreen')}
              />

<Button
                title="Inscription"
                loading={false}
                loadingProps={{ size: 'small', color: 'white' }}
                buttonStyle={{
                  backgroundColor: 'rgba(111, 202, 186, 1)',
                  borderRadius: 5,
                }}
                titleStyle={{ fontWeight: 'bold', fontSize: 23 }}
                containerStyle={{
                  marginHorizontal: 50,
                  height: 50,
                  width: 200,
                  marginVertical: 10,
                }}
                onPress={() => console.log('inscrire')}
              />
    </View >)
  }
}

const styles = StyleSheet.create({
  button: {
      width: '100%',
      marginVertical: 10,
      fontWeight: 'bold',
      fontSize: 40
  },
  text: {
    textAlign: 'center',
    padding: 5,
    fontWeight: 'bold',
    lineHeight: 80,
  },
});
